import React from "react";
import Cards from "./Cards";
import contacts from "../contacts.js";

function createCard(contacts)
{
  return (
    name=contacts.name
  );
}


function App() {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <Cards name={contacts[0].name} imgURL={contacts[0].imgURL} phone={contacts[0].phone} email={contacts[0].email}/>
      <Cards name={contacts[1].name} imgURL={contacts[1].imgURL} phone={contacts[1].phone} email={contacts[1].email}/>
      <Cards name={contacts[2].name} imgURL={contacts[2].imgURL} phone={contacts[2].phone} email={contacts[2].email}/>
    </div>
  );
}

export default App;
